        textDecorationLine: 'line-through', 
        textDecorationStyle: 'solid'
    }
    const {item,onDelete, handleToggle, selected}=props;
    //let show=item.map(item=>item);
    console.log(item) 
    console.log(selected+"In result")
    let itemShow = item.map((item, key,id) =>{    

     return ( 
        <div  style={{textDecorationLine: selected?'line-through':'none',textDecorationStyle: selected?'solid':'none', border: selected?' 2px solid green':'1px solid black'}}>
         <li class="list-group-item"  key={key}>{item} 
         <Button onClick={()=>onDelete(id)}style={btnStyle}variant="danger">Delete</Button></li>
         </div>
        )})

    return (
        <div>
            <ListGroup as="ul">
                 {itemShow}
            </ListGroup>
        </div>
    )
}
